 .attr("x",(d,i)=>i*180).attr("y",0).attr("width",14).attr("height",14).attr("fill",d=>d.color);
legend.selectAll("text").data(legendData).enter().append("text")
 .attr("x",(d,i)=>i*180+20).attr("y",12).text(d=>d.label);

const pctGroup = svg.append("g");

function calc(tCut){{
  const total=rawData.length;
  const sum=f=>{{ const s=rawData.filter(f); return {{acc:s.length, def:s.filter(d=>d['Good/Bad Flag']===1).length}}; }};
  const bank=sum(d=>d['Bank Internal Score']<=bankCut);
  const telco=sum(d=>d['FinScore Telco']>=tCut);
  const comb=sum(d=>d['Bank Internal Score']<=bankCut&&d['FinScore Telco']>=tCut);
  const filt=rawData.filter(d=>d['Bank Internal Score']<=bankCut&&d['FinScore Telco']<tCut).length/total;
  const sec=o=>{{const good=(o.acc-o.def)/total,bad=o.def/total;return {{good,bad,reject:1-good-bad}};}};
  const b=sec(bank), t=sec(telco), c=Object.assign(sec(comb),{{filtered:filt,reject:1-sec(comb).good-sec(comb).bad-filt}});
  const save=(bank.def/bank.acc - (comb.acc? comb.def/comb.acc:0))*pesoPerLoan;
  return {{sections:[b,t,c],acc:[b.good+b.bad,t.good+t.bad,c.good+c.bad],def:[b.bad/(b.good+b.bad||1),t.bad/(t.good+t.bad||1),c.bad/(c.good+c.bad||1)],save}};
}}
const bars=svg.append("g");

function draw(tCut){{
  const m=calc(tCut); bars.selectAll("*").remove();
  ['good','bad','filtered','reject'].forEach;
  m.sections.forEach((bar,i)=>{{let x=barX;
    ['good','bad','filtered','reject'].forEach(k=>{{const w=(bar[k]||0)*barW;if(w>0){{bars.append("rect").attr("x",x).attr("y",barY+i*barS).attr("width",w).attr("height",barH).attr("fill",schemes[k]); x+=w;}}}});
  }});
  pctGroup.selectAll("*").remove();
  m.acc.forEach((a,i)=>{{pctGroup.append("text").attr("x",barX+barW+10).attr("y",barY+i*barS+barH/2+4).attr("class","percent-text").text("A: "+(a*100).toFixed(1)+"%  D: "+(m.def[i]*100).toFixed(1)+"%");}});
  document.getElementById('savingsValue').textContent="₱ "+Math.round(m.save).toLocaleString();
}}

const slider=document.getElementById("telcoSlider"), out=document.getElementById("sliderVal");
slider.addEventListener("input",()=>{{out.textContent=slider.value;draw(+slider.value);}});
let play=false,timer;
document.getElementById("playBtn").addEventListener("click",()=>{{play=!play;this.textContent=play?"Pause":"Play"; if(play){{timer=setInterval(()=>{{slider.value=(+slider.value+1)%11;out.textContent=slider.value;draw(+slider.value);}},1600);}}else clearInterval(timer);}});
draw(+slider.value);
</script>
</body>
</html>
